import React from 'react';

import { Container, Main } from './styles';
import Header from '../../components/Header';
import Aside from '../../components/Aside';

const ExtraDebitsGradesMenu: React.FC = () => {
  return (
    <Container>
      <Header />

      <Aside />

      <Main />
    </Container>
  );
};

export default ExtraDebitsGradesMenu;
